const level= document.querySelector('.level');

const searchInput = document.querySelector("#search")
const searchResult = document.querySelector(".main-content")

// dataArray = OrderList(data)
creatUserList(dataArray)

function OrderList(focusLevel){
	const orderedData = focusLevel.sort( (a,b) => {
		if  (a.nom.toLowerCase()<b.nom.toLowerCase()){
			return -1;
		}
		if  (a.nom.toLowerCase()>b.nom.toLowerCase()){
			return 1;
		}
		return 0;
	})
	return orderedData;
}

function creatUserList(usersList) {
	usersList.forEach(user =>{
		const ref = document.createElement('a')
		ref.href=user.source
		const listItem = document.createElement("div");
		listItem.classList.add('table-item')

		ref.innerHTML = `
			<p class="name">${user.nom}</p>

			<p class="ecue1" style="color:orange;">${user.matiere}</p>

			<p class="mail">${user.mode}</p>

		  `
		  listItem.appendChild(ref)
		  searchResult.appendChild(listItem)
	})
}

level.addEventListener('click',()=>{
	
	levl = level.value.trim()
	focusLevel=dataL[levl]
	dataArray = OrderList(focusLevel)
	searchResult.innerHTML = ""
	creatUserList(dataArray);
	// console.log(focusLevel)
})

searchInput.addEventListener("input",filterData)

function filterData(e){
	searchResult.innerHTML = ""

	const searchedString = e.target.value.toLowerCase().replace(/\s/g,"");

	const filteredArr = dataArray.filter( el => el.nom.toLowerCase().includes(searchedString) || el.matiere.toLowerCase().includes(searchedString) || `${el.nom + el.matiere}`.toLowerCase().replace(/\s/g, "").includes(searchedString) || `${el.matiere + el.nom}`.toLowerCase().replace(/\s/g, "").includes(searchedString) || el.matiere.toLowerCase().includes('all') || el.matiere.toLowerCase().includes('global') );
	
	creatUserList(filteredArr)
}
